  "translationLines": [
    {
      "lineNumber": 151381,
      "originalJapaneseLine": "「あと、私に危害を加えないようにすることね！」",
      "translatedEnglishLine": "\"And also, make sure not to harm me!\""
    },
    {
      "lineNumber": 151382,
      "originalJapaneseLine": "「勝手に変な条件追加すんな！」",
      "translatedEnglishLine": "\"Don't add weird conditions on your own!\""
    },
    {
      "lineNumber": 151383,
      "originalJapaneseLine": "「ま、だがペルエレの言う通りだ。",
      "translatedEnglishLine": "\"Well, but what Peruere said is true."
    },
    {
      "lineNumber": 151384,
      "originalJapaneseLine": "　ケッセルリンクを復活させたくば俺に従え」",
      "translatedEnglishLine": "If you want to revive Kessel Link, obey me.\""
    },
    {
      "lineNumber": 151385,
      "originalJapaneseLine": "「そーだなー。",
      "translatedEnglishLine": "\"That's right."
    },
    {
      "lineNumber": 151386,
      "originalJapaneseLine": "　百年後とかなら俺は死んでるし、",
      "translatedEnglishLine": "If it's a hundred years from now or so, I'll be dead,"
    },
    {
      "lineNumber": 151387,
      "originalJapaneseLine": "　勝手に復活とかしても構わんぞ」",
      "translatedEnglishLine": "I don't mind if you go ahead and revive him on your own.\""
    },
    {
      "lineNumber": 151388,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 151389,
      "originalJapaneseLine": "「む、さすがに長すぎ？",
      "translatedEnglishLine": "\"Hmm, is that too long after all?"
    },
    {
      "lineNumber": 151390,
      "originalJapaneseLine": "　もうちょい縮める？」",
      "translatedEnglishLine": "Should I shorten it a little more?\""
    },
    {
      "lineNumber": 151391,
      "originalJapaneseLine": "「はあ……",
      "translatedEnglishLine": "\"Haa..."
    },
    {
      "lineNumber": 151392,
      "originalJapaneseLine": "　いえ、条件はそれで結構。",
      "translatedEnglishLine": "No, those conditions are fine."
    },
    {
      "lineNumber": 151393,
      "originalJapaneseLine": "　私達は貴方に――ひいては人類軍に従います」",
      "translatedEnglishLine": "We will obey you—and by extension, the Human Army.\""
    },
    {
      "lineNumber": 151394,
      "originalJapaneseLine": "「私達には……",
      "translatedEnglishLine": "\"We have..."
    },
    {
      "lineNumber": 151395,
      "originalJapaneseLine": "　それ以外選択肢がないようですので……」",
      "translatedEnglishLine": "Apparently no other choice besides that...\""
    },
    {
      "lineNumber": 151396,
      "originalJapaneseLine": "「おっ、そうか！",
      "translatedEnglishLine": "\"Oh, I see!"
    },
    {
      "lineNumber": 151397,
      "originalJapaneseLine": "　がははは！　グッドだー！」",
      "translatedEnglishLine": "Gahahaha! Good!\""
    },
    {
      "lineNumber": 151398,
      "originalJapaneseLine": "「むほほほ！　それでは、早速身体検査じゃー！」",
      "translatedEnglishLine": "\"Muhohoho! Then, let's start the physical examination right away!\""
    },
    {
      "lineNumber": 151399,
      "originalJapaneseLine": "「ぎゃー！　なんで私に――ッ！",
      "translatedEnglishLine": "\"Gyaa! Why me—!"
    },
    {
      "lineNumber": 151400,
      "originalJapaneseLine": "　触るな！　殺してやるーッ！」",
      "translatedEnglishLine": "Don't touch me! I'll kill you!\""
    },
    {
      "lineNumber": 151401,
      "originalJapaneseLine": "「がははは、ケッセルメイド達ゲーット！",
      "translatedEnglishLine": "\"Gahahaha, got the Kessel maids!"
    },
    {
      "lineNumber": 151402,
      "originalJapaneseLine": "　グッドだー！」",
      "translatedEnglishLine": "Good!\""
    },
    {
      "lineNumber": 151403,
      "originalJapaneseLine": "「こいつ……",
      "translatedEnglishLine": "\"This guy..."
    },
    {
      "lineNumber": 151404,
      "originalJapaneseLine": "　ケッセルリンク倒したことより喜んでやがる」",
      "translatedEnglishLine": "He's happier about this than having defeated Kessel Link.\""
    },
    {
      "lineNumber": 151405,
      "originalJapaneseLine": "「こいつは……もう、本当に……」",
      "translatedEnglishLine": "\"This guy... really, truly...\""
    },
    {
      "lineNumber": 151406,
      "originalJapaneseLine": "ランス達が騒いでいる中、",
      "translatedEnglishLine": "While Rance and the others are making a fuss,"
    },
    {
      "lineNumber": 151407,
      "originalJapaneseLine": "エルシールがこっそりとペルエレに声をかける。",
      "translatedEnglishLine": "Elsir quietly speaks to Peruere."
    },
    {
      "lineNumber": 151408,
      "originalJapaneseLine": "「ねえ、ペルエレ……」",
      "translatedEnglishLine": "\"Hey, Peruere...\""
    },
    {
      "lineNumber": 151409,
      "originalJapaneseLine": "「……恨み言なら聞かないわよ？",
      "translatedEnglishLine": "\"...I won’t listen to complaints, okay?"
    },
    {
      "lineNumber": 151410,
      "originalJapaneseLine": "　敵同士なら騙し合いは当然でしょ？」",
      "translatedEnglishLine": "It's natural to deceive each other when we're enemies, right?\""
    },
    {
      "lineNumber": 151411,
      "originalJapaneseLine": "「うぅん、そのことじゃなく……」",
      "translatedEnglishLine": "\"No, it’s not about that...\""
    },
    {
      "lineNumber": 151412,
      "originalJapaneseLine": "「ケッセルリンク様の死を聞いて、",
      "translatedEnglishLine": "\"When we heard of Lord Kessel Link’s death,"
    },
    {
      "lineNumber": 151413,
      "originalJapaneseLine": "　私達は全員、本当に自害する気だった」",
      "translatedEnglishLine": "we all truly intended to commit suicide.\""
    },
    {
      "lineNumber": 151414,
      "originalJapaneseLine": "「あなた……止めてくれたの？」",
      "translatedEnglishLine": "\"You... stopped us?\""
    },
    {
      "lineNumber": 151415,
      "originalJapaneseLine": "「別に……」",
      "translatedEnglishLine": "\"Not really...\""
    },
    {
      "lineNumber": 151416,
      "originalJapaneseLine": "「『最後に』頼まれたから、",
      "translatedEnglishLine": "\"I was asked 'one last time,'"
    },
    {
      "lineNumber": 151417,
      "originalJapaneseLine": "　聞いてあげようと思っただけよ」",
      "translatedEnglishLine": "so I just thought I’d listen.\""
    },
    {
      "lineNumber": 151418,
      "originalJapaneseLine": "「……そう」",
      "translatedEnglishLine": "\"...I see.\""
    },
    {
      "lineNumber": 151419,
      "originalJapaneseLine": "「それにしても……",
      "translatedEnglishLine": "\"Even so..."
    },
    {
      "lineNumber": 151420,
      "originalJapaneseLine": "　まさかペルエレに裏切られるなんて……」",
      "translatedEnglishLine": "I never thought Peruere would betray us...\""
    },
    {
      "lineNumber": 151421,
      "originalJapaneseLine": "「はあ……」",
      "translatedEnglishLine": "\"Haa...\""
    },
    {
      "lineNumber": 151422,
      "originalJapaneseLine": "「あなたにとってのケッセルリンク様、",
      "translatedEnglishLine": "\"For you, Lord Kessel Link"
    },
    {
      "lineNumber": 151423,
      "originalJapaneseLine": "　もう、いたんじゃない」",
      "translatedEnglishLine": "is no longer there, right?\""
    },
    {
      "lineNumber": 151424,
      "originalJapaneseLine": "「えっ……？」",
      "translatedEnglishLine": "\"Eh...?\""
    },
    {
      "lineNumber": 151425,
      "originalJapaneseLine": "「いや、ちゃうちゃう。",
      "translatedEnglishLine": "\"No, no, that’s not what I meant."
    },
    {
      "lineNumber": 151426,
      "originalJapaneseLine": "　これはそーゆーんじゃないから」",
      "translatedEnglishLine": "This isn’t that kind of thing.\""
    },
    {
      "lineNumber": 151427,
      "originalJapaneseLine": "「えっ、えっ？」",
      "translatedEnglishLine": "\"Eh, eh?\""
    },
    {
      "lineNumber": 151428,
      "originalJapaneseLine": "「がははは！",
      "translatedEnglishLine": "\"Gahahaha!"
    },
    {
      "lineNumber": 151429,
      "originalJapaneseLine": "　なんにしろ、これでメイドは全員俺のものー！」",
      "translatedEnglishLine": "Anyway, with this, all the maids are mine!\""
    },
    {
      "lineNumber": 151430,
      "originalJapaneseLine": "「よーし、帰るぞ！」",
      "translatedEnglishLine": "\"Alright, let's go home!\""
    }
  ]
}

